import React from 'react';
import './footer.css';

function Footer() {
  return (
    <footer className='footer__container'>
      <div className='footer__left'>
        <h4>what happened</h4>
        <p>
          [공지] 개인 정보 처리 방침 변경 사전 안내 [공지] 29CM 강남 스토어 영업
          종료 [공지] 개인 정보 처리 방침 변경 사전 안내 [공지] iOS 10 이하 버전
          지원 중단 안내 [공지] 개인 정보 처리 방침 변경 사전 안내
        </p>
      </div>
      <div className='footer__right'>
        <div className='footer__column footer__about-us'></div>
        <div className='footer__column footer__my-order'></div>
        <div className='footer__column footer__my-account'></div>
        <div className='footer__column footer__help'></div>
      </div>
    </footer>
  );
}

export default Footer;
